import React from 'react';

const Weather =(props)=>(
			<div>
		 		{props.sohor && props.desh && <p>Location: {props.sohor}, {props.desh}</p>} 
		 		{props.tapmatra && <p>Temperature: {props.tapmatra}</p>}
		 		{props.soitto && <p>Humidity: {props.soitto}</p>}
		 		{props.bornona && <p>Description: {props.bornona}</p>}
		 		{props.error && <p>{props.error}</p>}
		 	</div>
		)


export default Weather;
